import React from "react";
import { Link } from "react-router-dom";

const AdminDashboard = () => {
  const styles = {
    container: {
      display: "flex",
      minHeight: "100vh",
      margin: 0,
      fontFamily: "'Roboto', sans-serif",
      backgroundColor: "#f8fafc",
    },
    sidebar: {
      width: "280px",
      backgroundColor: "#1c2833",
      color: "#ecf0f1",
      padding: "30px 20px",
      boxShadow: "2px 0 5px rgba(0, 0, 0, 0.1)",
    },
    sidebarTitle: {
      fontSize: "28px",
      fontWeight: "bold",
      textAlign: "center",
      marginBottom: "30px",
      letterSpacing: "1px",
    },
    sidebarLink: {
      color: "#ecf0f1",
      textDecoration: "none",
      display: "block",
      padding: "12px 20px",
      borderRadius: "5px",
      margin: "5px 0",
      transition: "all 0.3s ease",
      fontSize: "16px",
      fontWeight: "500",
    },
    sidebarLinkHover: {
      backgroundColor: "#34495e",
      textDecoration: "none",
    },
    mainContent: {
      flexGrow: 1,
      padding: "30px",
    },
    header: {
      backgroundColor: "#007BFF",
      color: "#fff",
      padding: "20px",
      borderRadius: "8px",
      marginBottom: "20px",
      textAlign: "center",
      boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    },
    cardsContainer: {
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
      gap: "20px",
    },
    card: {
      backgroundColor: "#ffffff",
      padding: "20px",
      borderRadius: "10px",
      textAlign: "center",
      boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
      transition: "transform 0.3s ease, box-shadow 0.3s ease",
      border: "1px solid #e3e6ea",
    },
    cardHover: {
      transform: "scale(1.03)",
      boxShadow: "0 6px 12px rgba(0, 0, 0, 0.2)",
    },
    cardTitle: {
      fontSize: "18px",
      fontWeight: "600",
      marginBottom: "10px",
    },
    cardLink: {
      color: "#007BFF",
      textDecoration: "none",
      fontWeight: "bold",
      padding: "10px 20px",
      borderRadius: "5px",
      backgroundColor: "#f1f5f9",
      border: "1px solid #007BFF",
      transition: "background-color 0.3s ease, color 0.3s ease",
    },
    cardLinkHover: {
      backgroundColor: "#007BFF",
      color: "#ffffff",
    },
  };

  return (
    <div style={styles.container}>
      {/* Sidebar */}
      <div style={styles.sidebar}>
        <h2 style={styles.sidebarTitle}>ADMIN</h2>
        <ul className="list-unstyled">
          {[
            { to: "/", label: "Dashboard" },
            { to: "/StudentDetails", label: "Student Details" },
            { to: "/StudentRegistration", label: "Student Registration" },
            { to: "/MarkView", label: "Mark View" },
            { to: "/station-registration", label: "Station Master Registration" },
            { to: "/station-list", label: "Station Master List" },
            { to: "/report", label: "Report" },
            { to: "/logout", label: "Logout" },
          ].map((item, index) => (
            <li key={index}>
              <Link
                to={item.to}
                style={styles.sidebarLink}
                onMouseEnter={(e) => (e.target.style.backgroundColor = "#34495e")}
                onMouseLeave={(e) => (e.target.style.backgroundColor = "transparent")}
              >
                {item.label}
              </Link>
            </li>
          ))}
        </ul>
      </div>

      {/* Main Content */}
      <div style={styles.mainContent}>
        <header style={styles.header}>
          <h1>Welcome to MCA - Ste Dashboard</h1>
        </header>
        <div style={styles.cardsContainer}>
          {[
            { title: "Boat", text: "Manage Boat Details", to: "/boat" },
            { title: "Event", text: "Manage Events", to: "/event" },
            { title: "Settings", text: "Manage Station Master Details", to: "/settings" },
          ].map((card, index) => (
            <div
              style={styles.card}
              key={index}
              onMouseEnter={(e) =>
                Object.assign(e.currentTarget.style, styles.cardHover)
              }
              onMouseLeave={(e) =>
                Object.assign(e.currentTarget.style, {
                  transform: "scale(1)",
                  boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
                })
              }
            >
              <h3 style={styles.cardTitle}>{card.title}</h3>
              <p>{card.text}</p>
              <Link
                to={card.to}
                style={styles.cardLink}
                onMouseEnter={(e) => (e.target.style.backgroundColor = "#007BFF")}
                onMouseLeave={(e) => (e.target.style.backgroundColor = "#f1f5f9")}
              >
                More info &#8594;
              </Link>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
